    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}
    """

    # Convert the input string to a list of letters
    letters = test.split()

    # Initialize an empty dictionary to store the counts of each letter
    counts = {}

    # Loop through each letter in the list
    for letter in letters:
        # If the letter is already in the dictionary, increment its count
        if letter in counts:
            counts[letter] += 1
        # Otherwise, add the letter to the dictionary with a count of 1
        else:
            counts[letter] = 1

    # Find the maximum count of any letter in the dictionary
    max_count = max(counts.values())

    # Create a new dictionary to store the letters with the maximum count
    max_counts = {}

    # Loop through each letter and its count in the original dictionary
    for letter, count in counts.items():
        # If the count matches the maximum count, add the letter to the new dictionary
