def collatz_sequence(n):
    """
    Returns the Collatz sequence for a given positive integer n.
    """
    sequence = [n]
    while n > 1:
        if n % 2 == 0:
            n //= 2
        else:
            n = 3 * n + 1
        sequence.append(n)
    return sequence

